import SheetDB from "sheetdb-js";

async function GetUsers(){
    SheetDB.read('https://sheetdb.io/api/v1/n4u08xvj0qycn', {}).then(function (result) {
        return result;
    }, function (error) {
        return error;
    });
}

export default GetUsers;
